export default function Tuning({ socket }) {
    const [octave, setOctave] = useState(0)

    return (
        <div className="tuning" >
            <select>
                <option>Select an Octave</option>
                <option>Octave 1</option>
                <option>Octave 2</option>
                <option>Octave 3</option>
                <option>Octave 4</option>
                <option>Octave 5</option>
                <option>Octave 6</option>
                <option>Octave 7</option>
                <option>Octave 8</option>
            </select>
        octave != 0 ? <OctaveTuning socket={socket} octave = {octave} />
        </div>
    );
}
